			// 当进行数据库所搜后
			// this.getDiagnose();
			// var arr=[
			// 		{"name":"消化道出血222222","age":"19"},
			// 		{"name":"消化道肿瘤","age":"19"},
			// 		{"name":"消化道溃疡","age":"19"}
