			for (var j = 0; j < this.diagnosesMenu.length; j++) {
				this.diagnosesMenu[j].addFirst = false;
			}
			if (this.diagnosesMenu.length != 0) {
				this.diagnosesMenu[0].addFirst = true;
			}
